      logger.info(s"Circle:$i  Region:$region   Step3 Five Table To Wide Table Complete.....")
      i += 1
    })

    hiveContext.stop()
    logger.info("   Stop Process Five Table To Wide Table .....")
  }

  def getRegion(regionPath: String): Unit = {
    val endIndex = regionPath.length()
    val startIndex = regionPath.length() - 12
    val date_m = regionPath.substring(startIndex, endIndex)
    //println("dealStep2Sql date_m:" + date_m)
    regions += date_m
  }

  def getStep1Sql(finalxml: String, region: String): Unit = {
    arrayBuffer_step1.clear()
    //val d1="drop table src.o_rm_ev_tpd_eutrancell_q_enodeb_pm_V2_6_ad_d_v2"
    val regionDay = region.substring(0, 8)
    val regionPath = finalxml + "/" + regionDay + "/" + region + "_versions.properties"
    val dropAndCreate = new FileInputStream(regionPath)
    dropAndCreatePro.load(dropAndCreate)
    val dropAndCreateSets = dropAndCreatePro.keySet()
    dropAndCreateSets.toArray.foreach(dropAndCreateProKey => {
      val dropAndCreateProValue = dropAndCreatePro.getProperty(dropAndCreateProKey.toString)
      arrayBuffer_step1 += dropAndCreateProValue
    })
  }

  def dealStep2Sql(regionPath: String, hiveContext: SparkSession, finalpathPros: Properties, sqlPros: Properties): Unit = {
    val endIndex = regionPath.length()
    val startIndex = regionPath.length() - 12
    val date_m = regionPath.substring(startIndex, endIndex)
    println("dealStep2Sql date_m:" + date_m)
    //val finalpathPros = PropertiesUtil.properties("G:\\Users\\lkz\\IdeaProjects\\ftptohdfsauto_v2\\src\\main\\java\\cn\\hbwy\\ftptohdfs\\hdfsdeal\\fianlpath.properties")
    //val sqlPros = PropertiesUtil.properties("G:\\Users\\lkz\\IdeaProjects\\ftptohdfsauto_v2\\src\\main\\scala\\cn.hbwy.ftptohdfsscala\\parametersqlv3.properties")
    finalpathPros.keySet().toArray.foreach(pros => {
      val valuePros = finalpathPros.getProperty(pros.toString)
      val finalPros = valuePros.split("001")
      val finalParentPath = finalPros(0)
      val matchVerison = finalPros(1)
      println("------------------------------------------")
      println("------------------------------------------")
      println("------------------------------------------")
      println("finalParentPath:" + finalParentPath)
      println("matchVerison:" + matchVerison)
      println("loadVersion:" + finalPros(2))
      println("------------------------------------------")
      println("------------------------------------------")
      println("------------------------------------------")
      if (regionPath.matches(matchVerison)) {
        val loadVersion = finalPros(2)
        val loadSql = sqlPros.getProperty(loadVersion)
        val strs = loadSql.split("001")
        val loadSqlGeneral = strs(0) + regionPath + strs(1) + date_m + strs(2)
        println("------------------------------------------")
        println("------------------------------------------")
        println("------------------------------------------")
        println("loadSqlGeneral:" + loadSqlGeneral)
        println("------------------------------------------")
        println("------------------------------------------")
        println("------------------------------------------")
        hiveContext.sql(loadSqlGeneral)
      }
    })
  }

  def getStep3Sql(date_m: String, versionKeys: Properties, sqlPros: Properties): Unit = {
    arrayBuffer_step3.clear()
    //val versionKeys = PropertiesUtil.properties("G:\\Users\\lkz\\IdeaProjects\\ftptohdfsauto_v2\\src\\main\\scala\\cn.hbwy.ftptohdfsscala\\versionskeys.properties")
    //val sqlPros = PropertiesUtil.properties("G:\\Users\\lkz\\IdeaProjects\\ftptohdfsauto_v2\\src\\main\\scala\\cn.hbwy.ftptohdfsscala\\parametersqlv3.properties")

    versionKeys.keySet().toArray.foreach(key => {
      val valuesStrs = versionKeys.getProperty(key.toString)
      val valueskeys = valuesStrs.split("001")
      val valueCreateKey = valueskeys(1)
      val ts = dropAndCreatePro.getProperty(valueCreateKey)
      if (ts != null) {
        val createVersion1 = ArrayBuffer[String]()
        createVersion1 += ts
        val selectFields = GenerateSelect.parseToSelect(createVersion1)
        val valueSelectKey = valueskeys(0)
        val sqlVersion = sqlPros.getProperty(valueSelectKey)
        val sqlSelect = sqlVersion.split("001")
        val general_select_sql = "select " + selectFields(0) + " " + sqlSelect(0) + date_m + sqlSelect(1)
        arrayBuffer_step3 += general_select_sql
      }
    })
  }

