  def getTime(): String = {
    var d = new Date()
    val a = d.getTime
    var sim = new SimpleDateFormat("yyyy-MM-dd hh:mm:ss")
    sim.format(a)
  }

  def getMinusTime(region: String): String = {
    val sdate = new SimpleDateFormat("yyyyMMddHHmm")
    var regionMinus15 = ""
    //region:201810251015
    val d = sdate.parse(region)
    val gc = new GregorianCalendar
    gc.setTime(d)
    //表述减去15m
    gc.add(12, -15)
    regionMinus15 = sdate.format(gc.getTime)
    regionMinus15
  }
